# In[48]:

def pos_to_s(pos):
    return pos[0]+pos[1]*map_width

def s_to_pos(index):
    x = index%map_width
    y = (index-x)/map_width
    return (x,y)

def succ_s(s):
    pos = s_to_pos(s)
    neighbors = [
         [pos[0]+1,pos[1]],
         [pos[0]-1,pos[1]],
         [pos[0]  ,pos[1]+1],
         [pos[0]  ,pos[1]-1],
         [pos[0]+1,pos[1]+1],
         [pos[0]-1,pos[1]+1],
         [pos[0]+1,pos[1]-1],
         [pos[0]-1,pos[1]-1],
        ]
    succ_l = []
    for xy in neighbors:
        if xy[0]<0 or xy[0]>=map_width or xy[1]<0 or xy[1]>=map_height: #within map
            continue
        s = pos_to_s(xy)
        succ_l.append(s)
    return succ_l

def pred_s(s):
    return succ_s(s)


